INSERT INTO `v1_b5b75089bbea3e8f88d466febc30d43722e68857680cd87864c98df21a2e9e10` VALUES (0, 36, "", 0, 40000, 8, 91002, "", 1, 0, 100);
INSERT INTO `v1_b5b75089bbea3e8f88d466febc30d43722e68857680cd87864c98df21a2e9e10` VALUES (0, 37, "ぺコリーヌ", 1, 40001, 8, 91002, "今日は記念日、お祝いですね！\n焼肉、お寿司、ピザ、ケーキ～☆\nあなたとパーティできるなんて、\n幸せです～♪", 1, 107501, 150);
INSERT INTO `v1_b5b75089bbea3e8f88d466febc30d43722e68857680cd87864c98df21a2e9e10` VALUES (0, 38, "コッコロ", 1, 40001, 8, 91002, "この記念日を迎えられたのは、\n主さまの器量の賜物\nさすがは主さまでございます\nえらい、えらい♪", 2, 107601, 150);
INSERT INTO `v1_b5b75089bbea3e8f88d466febc30d43722e68857680cd87864c98df21a2e9e10` VALUES (0, 39, "キャル", 1, 40001, 8, 91002, "あんたもけっこうやるじゃない！\nちょっとは…割と…け、けっこう\n見直しちゃったわ\n褒めてあげる♪", 3, 107801, 150);
INSERT INTO `v1_b5b75089bbea3e8f88d466febc30d43722e68857680cd87864c98df21a2e9e10` VALUES (0, 40, "スズメ", 1, 40001, 8, 91002, "あなたと私にとって、\n今日は特別な日\nあなたの支えがあるから、\n私は頑張れるんです！", 4, 107701, 150);
INSERT INTO `v1_b5b75089bbea3e8f88d466febc30d43722e68857680cd87864c98df21a2e9e10` VALUES (0, 41, "タマキ", 1, 40001, 8, 91002, "今日はキミにとっての\n特別な記念日だにゃ\nキミの活躍にはいつも\n猫ながら感謝してるにゃ～♪", 5, 107901, 150);
INSERT INTO `v1_b5b75089bbea3e8f88d466febc30d43722e68857680cd87864c98df21a2e9e10` VALUES (0, 42, "ぺコリーヌ", 2, 40001, 8, 91002, "う～かき氷食べ過ぎて、\n身体が冷えちゃいました…\nあなたの体温で温めてください！\nギューーッ♪", 6, 107501, 150);
INSERT INTO `v1_b5b75089bbea3e8f88d466febc30d43722e68857680cd87864c98df21a2e9e10` VALUES (0, 43, "コッコロ", 2, 40001, 8, 91002, "夏は危険がいっぱいと申します…\nですが、わたくしが主さまを\nしっかりとお守りいたしますよ", 7, 107601, 150);
INSERT INTO `v1_b5b75089bbea3e8f88d466febc30d43722e68857680cd87864c98df21a2e9e10` VALUES (0, 44, "キャル", 2, 40001, 8, 91002, "ん～なんであんたと、ひと夏を\n過ごすことになったのかな…\n結構楽しいからいいけど！\nさ、まだまだ遊ぶわよ！", 8, 107801, 150);
INSERT INTO `v1_b5b75089bbea3e8f88d466febc30d43722e68857680cd87864c98df21a2e9e10` VALUES (0, 45, "スズメ", 2, 40001, 8, 91002, "あなたと過ごすはじめての夏…\nいまからドキドキが止まりません\n楽しくて素敵な思い出が、\nまた一つ増えるんですね♪", 9, 107701, 150);
INSERT INTO `v1_b5b75089bbea3e8f88d466febc30d43722e68857680cd87864c98df21a2e9e10` VALUES (0, 46, "タマキ", 2, 40001, 8, 91002, "夏は一番の稼ぎ時にゃのに、\n今年はキミと過ごしたいって\n思ってるにゃ楽しい思い出\n増やしてくれるかにゃ？", 10, 107901, 150);
