INSERT INTO `v1_b5b75089bbea3e8f88d466febc30d43722e68857680cd87864c98df21a2e9e10` VALUES (0, 322, "クリア", 1, 40011, 2, 24001, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 2, 126001, 1);
