INSERT INTO `v1_b5b75089bbea3e8f88d466febc30d43722e68857680cd87864c98df21a2e9e10` VALUES (0, 325, "クリア", 2, 40011, 2, 24001, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 5, 126001, 1);
